import React from 'react';

const Info = () => {
	return (
		<div className='comp-info'>
			<p className='comp-content'>
				Rick has traveled the world conducting his works that include premieres
				with the Denver Pops Symphony Orchestra, Williamsport Symphony
				Orchestra, USAF Band, Seika High School All Girls Band (Japan), and
				music for the closing ceremony of the 50 th Anniversary of the Singapore
				Youth Festival (Singapore). Since 2005 Rick has been writing and
				arranging for the Boston Brass and since 2011 has been the official
				arranger for Walt Disney World’s Thanksgiving Day Parade of Bands. In
				2019 Rick arranged 11 pieces for solo trumpet and string quartet for
				trumpeter Mary Bowden’s new CD Reverie.
			</p>
		</div>
	);
};

export default Info;
